import React from 'react';
import ReactDOM from 'react-dom';
import {Input,Divider} from 'antd';
import {DraftDemo} from './DraftDemo';
import {JoditDemo} from './JoditDemo';

ReactDOM.render(
  <Demo />,
  document.getElementById('root')
);


function Demo(){
    return <div>
        <div>
            <DraftDemo />
        </div>
        <Divider />
        <div>
            <JoditDemo />
        </div>
    </div>;
}
